import { Outlet, Link } from "react-router-dom";


const About=()=>
{
    return(
<>
  <h1> About To Home Page</h1>
   <div id="aboutBox">
       <div id="aboutLink">
         <Link to="abtcomp" >About Company </Link>
          
          <br /><br />
          <Link to="abtpdt" > About Product</Link>
          <br/><br/>
          <Link to="abtser" > About Services</Link>
       </div>
       <div id="aboutData">
        <Outlet/>

       </div>
   </div>
</>
    );
}

export default About;
